INSERT INTO `help` VALUES (100000,100005,'<style type=\"text/css\">.shop-step h5{\nfont-size:14px;\ncolor:#ffffff;\nheight:25px;\nline-height:25px;\npadding-left:12px;\nbackground-color: #49cbcd;\nfont-family:\"宋体\";\nfont-weight:bold;\n}\n.shop-step .txt{\npadding: 8px 0 8px 12px;\n}\n.shop-step .img{\npadding: 15px 0 30px 20px;\n}\n.shop-step .img img{\nmax-width: 767px;\n}\n</style>\n<div class=\"shop-step\">\n<h5>Step 1 进入新龙直销首页，点击页面左上角的&ldquo;免费注册&rdquo;</h5>\n\n<p class=\"img\"><img alt=\"选择注册\" height=\"219\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/af1d9e7f-8358-4b33-a2f9-87e0d6d90f60.png\" width=\"513\" /></p>\n\n<h5>Step 2 按照网页提示，填写准确的注册信息后点击&ldquo;确认提交&rdquo;</h5>\n\n<p class=\"img\"><img alt=\"注册\" height=\"453\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/11/d5134f2e-5984-4e75-ae35-40c913f71190.png\" width=\"613\" /></p>\n</div>'),(100001,100006,'<style type=\"text/css\">.shop-step h5{\nfont-size:14px;\ncolor:#ffffff;\nheight:25px;\nline-height:25px;\npadding-left:12px;\nbackground-color: #49cbcd;\nfont-family:\"宋体\";\nfont-weight:bold;\n}\n.shop-step .txt{\npadding: 8px 0 8px 12px;\n}\n.shop-step .img{\npadding: 15px 0 30px 20px;\n}\n.shop-step .img img{\nmax-width: 767px;\n}\n</style>\n<div class=\"shop-step\">\n<h5>1.选择品牌特卖/秒杀专场</h5>\n\n<p class=\"txt\">Step 1 在首页点击进入正在进行中的品牌特卖/秒杀专场，或是选择导航区的女士/男士，来浏览您感兴趣的商品</p>\n\n<p class=\"img\"><img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/2febd90c-c2d9-46d3-9179-1d6d08acfbec.jpg\" /></p>\n\n<h5>2.点击进入商品页</h5>\n\n<p class=\"txt\">Step 2 点击您感兴趣的商品进行查看</p>\n\n<p class=\"img\"><img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/644e0d29-9cc6-4eb5-814a-d5dc4bfa0d1a.jpg\" /></p>\n\n<h5>3.选择商品详细参数</h5>\n\n<p class=\"txt\">Step 3 选择您想要购买的商品详细参数，包括颜色、尺码、数量</p>\n\n<p class=\"img\"><img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/b55416a9-2a00-4537-b5c7-a620fbe0f5d2.jpg\" /></p>\n\n<h5>4.购物车</h5>\n\n<p class=\"txt\">Step 4 将所有您想购买的商品加入购物车后，请点击页面右上角的&quot;购物车&quot;</p>\n\n<p class=\"img\"><img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/5222029f-5624-4d64-ba13-d694c4877202.jpg\" /></p>\n\n<h5>5.立即结算</h5>\n\n<p class=\"txt\">Step 5 将所有您想购买的商品加入购物车，确认后点击&quot;立即结算&quot;</p>\n\n<p class=\"img\"><img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/d125c129-8011-4aad-8e71-2a0553fa8712.jpg\" /></p>\n\n<h5>6.用户登录</h5>\n\n<p class=\"txt\">Step 6 若您之前未登录，将会进入用户登录页面；如果您是新用户，请进行新会员注册；如果您已经注册过，请输<br />\n入用户名及密码，然后点击&quot;登录&quot;按钮；您也可以直接填写收货信息快速购物.</p>\n\n<p class=\"img\"><img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/fbfd9eda-0c73-4f0c-bfb6-b1a08f46148c.jpg\" /></p>\n\n<h5>7.填写收货信息</h5>\n\n<p class=\"txt\">Step 7 如果您是首次购物，请按照提示步骤，首先填写收货人信息，之后选择支付方式，您可以选择支付宝支付；<br />\n收货人信息可以进行保存；如果您需要发票可以在发票信息中选择您所需要的发票类型和填写抬头</p>\n\n<p class=\"img\"><img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/9be42468-6fa2-4909-80b0-66afd8e6eda5.jpg\" /></p>\n\n<h5>8.确认并提交订单</h5>\n\n<p class=\"txt\">Step 8 确认并提交订单，之后您的订单将可以在页面右上角&quot;我的订单&quot;处进行查看</p>\n\n<p class=\"img\"><img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/7cedc418-634a-4f67-9d6c-383df164b772.jpg\" /></p>\n\n<h5>9.订单提交成功</h5>\n\n<p class=\"txt\">Step 9 订单提交成功后，您可以&quot;继续购物&quot;，或点击&quot;我的订单&quot;进行查看</p>\n\n<p class=\"img\"><img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/16/b6648eb4-fca2-43c1-a098-c7bb511f6e64.jpg\" /></p>\n</div>'),(100002,100007,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">订单查询：</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、下单前请务必填写真实姓名和具体收货地址，以便订单顺利投递。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、 订购成功后，系统会根据不同的供应商自动将订单进行拆分，所订购的商品可能被拆分成多张订单，您可以通过我们发出的订单确认邮件或者在&ldquo;我的帐户&rdquo;中查询订单发货时间。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">配送信息跟踪：</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、订单发出后，您可以在自己的账户&ldquo;我的订单&rdquo;中查询到订单信息。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"color: rgb(51, 51, 51); font-size: 13px;\">&nbsp;2、你也可以根据商家给到的快递单号登录快递公司官方网站查询订单配送信息。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">问：结算过程中，因系统错误未完成支付的订单，应该怎么处理？下单成功后还有其他可以操作吗？</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">答：建议您可先在用户中心查询&ldquo;我的订单&rdquo;，核实款项是否已支付成功。如未支付成功，请您在订单管理中，点击&ldquo;支付&rdquo;进行付款。如您的款项已支付成功，但订单状态显示未支付，请您联系我司客服，我们将尽快为您处理。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">问：下单成功后，还可以进行修改吗？</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">答： 下单成功后</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">不可以进行修改，如果你需要修改信息，请联系我司客服，我们会尽快给您处理。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">问：下单成功后，如何查询配送情况？</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">答：当您的订单状态为&ldquo;已发货&rdquo;，此时您的商品已从</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">品牌供应商</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">仓库发出，并由物流公司进行配送。您可在</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">用户中心&ldquo;我的订单 &rdquo;中</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">查看承运物流公司名称及运单号，且可到物流公司网站进行追踪查询。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">问：下单后订单为什么没显示？</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">特别提示</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">在订单提交高峰时段，新订单可能一段时间之后才会在&ldquo;我的帐户&rdquo;中显示。如果您在&ldquo;我的帐户&rdquo;中暂未找到这张订单，请您耐心等待。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n'),(100003,100008,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">配送方式：</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\">&nbsp;</p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">新龙直销品牌供应商将通过专业的第三方物流公司为会员提供快速便捷的包裹配送。会员在新龙直销成功购买商品的每一个订单（限一个邮寄地址），品牌供应商会根据您所订购的商品生成相应的包裹发送到您的手中。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"color: rgb(51, 51, 51); font-size: 13px; font-weight: bold;\">&nbsp;配送范围：</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\">&nbsp;</p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">新龙直销配送范围覆盖全国大部分地区（港澳台地区除外）。</span></p>\n'),(100004,100009,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">商品验货与签收</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">快递员送货上门时，请您务必当面对照发货单核对商品</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">是否正确。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">特殊商品(如祙子、化妆品、化妆工具等）目前不允许试穿</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">3、</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">如您在订购时选择了&quot;需要发票&quot;，请仔细检查发票是否随商品一起送到，如未收到发票，请与</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">品牌供应商</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">联系为您补开发票。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">4、</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">签收后</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">新龙直销</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">视为您已经认可并接受</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">品牌供应商</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">商品。非订货人本人签收的产品，</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">新龙直销</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">视代收人等同于订购人进行验货。一旦您确认签字，</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">新龙直销</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">将无法为您办理退</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">货</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">或补发。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">修改配送要求</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、改寄：发货前改变邮寄地址不另收费，发货后恕不受理；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、签收：请检查包裹有无破损，如无问题，请在物流公司指定单据上签收，物流公司会将签收信息返回</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">品牌供应商</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">3、拒收：请检查包裹，如有明显损坏迹象，您可以拒收该包裹，</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">供应商</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">会与物流公司协商赔偿事项，并承担由此而产生的配送费用</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">长时间未收到货品可能出现的问题</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">（1） 请您确保订单中的收货地址、邮编、电话、Email地址等各项信息的准确性，以便商品及时、准确地发出，并随时查看</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">用户中心</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">里&quot;我的订单&quot;的状态更新情况</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">，如果长时间未收到货，可能是由于您填写的地址或电话号码有误，您可联系新龙客服为您处理。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">（2） 配送过程中如果我们联络您的时间超过7天未得到回复，此订单将被默认为您已经放弃订购。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n'),(100005,100010,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">支付方式：</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">目前新龙直销仅提供支付宝在线支付方式</span></p>\n'),(100006,100011,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><strong><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">开发票的注意事项</span></strong></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1.&nbsp; &nbsp; 个人及不具有一般纳税人资格的企业客户，均开具普通发票。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2.&nbsp; &nbsp;&nbsp;同一个入驻卖家售出的商品对应一张发票</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">3.&nbsp; &nbsp; 发票金额不能高于订单金额，使用代金券支付的金额不开具发票</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">4.&nbsp; &nbsp; 促销直减金额不开具发票</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">5.&nbsp; &nbsp; 积分换购商品金额不开具发票</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">6.&nbsp; &nbsp; 收到发票后，如发现发票抬头、内容或金额等不符，请先与商家客服中心联系确认。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n'),(100007,100012,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">&nbsp;正品保障：</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">新龙直销</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">所售的商品均</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">为</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">正规品牌，供应商类型包括品牌生产商、品牌授权总代理商、品牌授权总经销商、品牌分公司、品牌分支机构及国际品牌驻中国的办事处。</span></p>\n'),(100008,100013,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; font-weight: bold; color: rgb(51, 51, 51);\">退货政策：</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、会员在新龙直销购买商品如出现商品质量问题，会员可申请退货</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、出现以下任一情形时均不予退货</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 1）</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">超过退货有效期限（商品订单生成后15天内）的退货商品；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2）</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">未经网上申请退货或未通过商家客服中心申请退货而自行寄回至发货仓库的；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp;&nbsp;</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">3）</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">非1所述情形的美容化妆类、贴身商品（内衣、文胸、泳衣等）、食品类及黄金珠宝类商品。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">不支持上门取货</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">您办理退货后，需要自行联系物流公司将退货商品寄回商家仓库，因质量问题产生的退货，由客户先垫付运费，商家收到货物后，运费一并退还。暂不支持上门取件的服务，如有不便，敬请谅解！</span></p>\n'),(100009,100014,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size:9px;\"><strong>退货细则：</strong></span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">一、商品质量问题退货条例总则</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">问： 在商品订单生成后15天内退货且经网上申请退货或通过新龙直销品牌供应商申请退货的哪些情况下均满足退货条件（适用于所有品类商品）</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; &nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">答：1 商品质量问题</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; &nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">问：出现哪些情形时不予退货</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; &nbsp;&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">答：1、超过退货有效期限（商品订单生成后15天内）的退货商品；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; &nbsp; 2、未经网上申请退货或通过新龙直销品牌供应商申请退货而自行寄回至新龙直销或品牌供应商仓库的；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; &nbsp; 3、非1所述情形的美容化妆类、贴身商品（内衣、文胸、泳衣等）、食品类及黄金珠宝类商品。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">问： 新龙直销提供换货服务吗</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">答： 您好，由于新龙直销是以限时限量的折扣模式销售知名品牌商品，因此不提供换货服务，一律只作退货处理。如需要同款商品，建议您重新下单订购，此单可直接办理退货服务，收到退货后，会尽快为您办理退款。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">问：新龙直销支持上门取货服务吗</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">答：您办理退货后，需要自行联系物流公司将退货商品寄回新龙直销的品牌供应商指定仓库，新龙直销暂不支持上门取件的服务，如有不便，敬请谅解！</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">二、服饰箱包及鞋类商品退货细则</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1 退货原因</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 1.1商品质量问题</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2 注意事项</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.1出于安全和卫生考虑，贴身用品如内衣裤，袜子，文胸类及泳衣类等商品，除质量问题外，概不退货；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.2任何因非正常使用、保管或个人原因造成的商品损坏（如自行修改尺寸，洗涤，皮具表面刮花、打油，刺绣，水洗、碰酸、碱、油或者触硬物，雨天穿着，长时间穿着，五金配件缺少等），不予退货。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.3商品吊牌、发货单、商品配件（如配饰挂坠、肩带、小卡包等）、说明书、保修单、标签等丢失，不予退货；如您购买时索要发票，一经退货请将发票随商品一同寄回，如发票丢失将无法办理退货；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.4遇过敏问题产生退货需要提供医院的相关证明；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.5礼包或套装中的商品不可以部分退货，如有发票，赠品，等需同商品一起退回。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">三、美容化妆类商品退货细则</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、退货原因</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 1.1商品质量问题（根据国家相关法律规定，此类商品属于特殊商品，一经售出非质量问题概不退货）。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、注意事项</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.1出于安全和卫生考虑，贴身用品、化妆品不予退货，经权威部门检测商品存在内在质量问题者除外。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.2如商品包装破损，商品过期或离过期不到2个月可以申请退货；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.3商品销售页面明确标示商品保质期将到期、外包装有损坏或产品有瑕疵的，不得再以此为由要求退货。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.4遇过敏问题产生退货需要提供医院的相关证明。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.5我们保证商品的进货渠道和质量，如果您在使用时对商品质量表示质疑，请出具书面鉴定，我们会按照国家法律规定予以处理。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">温馨提示：化妆品的使用效果会因肤质、年龄、季节、气候、使用方法以及配套产品等的不同而效果不一，因此，介绍的功能及使用效果仅供参考，如果您对商品细节有任何疑问，请在订购前与客服联系并详细确认。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">.</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">四、食品类商品退货细则</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、从新龙直销网站订购的食品类商品，为了保证食品安全，请在收货时务必仔细查验商品及保质期，如发现商品存在包装破损，或保质期问题如商品过期或离过期不到2个月等，请您现场向配送人员指出后拒收整个包裹。此类商品，一旦签收后，不予接受退货。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、如果由国家食品质量监督检验机构公告的有质量问题的商品，新龙直销会提供退货。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">五、家居家纺类商品退货细则</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、退货原因</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 1.1商品质量问题</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、注意事项</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.1因个人原因造成商品损坏（如自行修改尺寸、洗涤）的，不予退货；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.2商品吊牌、发货单、商品配件、说明书、保修单及标签等丢失的或包装破损，不予退货。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">六、小家电类商品退货细则</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、退货原因</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 1.1商品质量问题</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、注意事项</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.1商品如出现质量问题，请先行按照说明书上的联系方式与厂家的售后部门联系，如果确认属于质量问题，凭品牌售后部门开具的质量检测单，请于新龙直销官网申请退货或与新龙直销品牌供应商的客服联系办理退货事宜；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.2退货时，请您务必将商品的外包装、内带附件、保修卡、说明书、发票等随同商品一起退回；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.3若商品在购买时附带赠品，办理退货时需将赠品一起退回；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.4因厂商会在没有任何提前通知的情况下更改商品包装、产地或者一些附件，因此您收到的商品有可能与我们提供的图片、产地、附件说明不完全一致，请您以收到商品实物中标示的包装清单为准；我们会尽量做到及时更新，同时确保商品为原装正品；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; 2.5个人护理相关商品，例如：剃须刀、女士剃/脱毛器、美容器、卷发器、理发器、电动牙刷、鼻毛器等，请当场验收，若商品有破损、渗漏、缺少、配送错误等问题，请当即与新龙直销客服人员或者品牌供应商的客服人员联系，在您签收验货后发现上述现象我们将不负责退货。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">七、手表类商品退货细则</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、退货原因</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 1.1商品质量问题</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、注意事项</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.1非人为损坏，且产品有质量问题的，将附件、说明书、保修卡、发票、购物凭证、原包装、商品一并返回我司办理退货手续</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.2手表类商品退货如商品单品页面有说明的，则以单品页面说明为准。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2.3以下情况不予办理退货：</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （1）商品自身携带的产品序列号与新龙直销所售出的不符；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （2）已佩戴过的商品和受损、污染的商品；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （3）任何因非正常使用及保管导致出现质量问题的商品；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （4）缺少随商品附带的保修卡、发票、配件等；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （5）商品已打开塑封包装或撕开开箱即损贴纸者，但有质量问题除外；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （6）将商品存储、暴露在超出商品适宜的环境中；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （7）未经授权的修理、误用、疏忽、滥用、事故、改动、不正确的安装；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （8）食物或液体溅落造成损坏；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （9）商品使用中出现的磨损，非质量问题；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （10）手表表带经过调整，但有质量问题除外；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （11）非质量问题。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">八、首饰礼品类商品退货细则</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、退货原因</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 1.1商品质量问题；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、注意事项</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.1对于附带国家级宝玉石鉴定中心出具的鉴定证书的，非质量问题不予退货；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.2您在收到商品之日起（以发票日期为准）3个月内，如果出现质量问题，请到当地的质量监督部门-珠宝玉石质量检验中心进行检测，如检测报告确认属于质量问题，请与新龙直销的品牌供应商客服中心联系办理退货事宜。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.3退货时，请您务必将商品的外包装、内带附件、鉴定证书、说明书等随同商品一起退回。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.4对于高档首饰都附带国家级宝玉石鉴定中心出具的鉴定证书，如果您对此有任何质疑，请到出具该证书的鉴定机构进行复检；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.5瑞士军刀、zippo打火机、钻石、18K金、白银，如无质量问题不退货，有质量问题请出示检测报告，方可退货；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.6黄金珠宝</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; （1）商品无质量问题不予退货</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; （2）验货签收后如商品无品质问题（包括发错货、空盒、明显划痕裂痕、松动脱落断裂等），不予退货</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; （3）商品开箱后，如有品质问题，联系新龙直销品牌供应商的客服办理退货。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.7为了保证您的利益，请您在收到商品时，仔细检查，如果您发现有任何问题，请您当时指出，并办理退货或拒收。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">九、运动健身器械、玩具类商品退货细则</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、退货原因</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 1.1商品质量问题</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、注意事项</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;&nbsp; 2.1出现以下任一情形时，均不予退货：</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （1）产品有明显使用痕迹；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （2）非正常条件下存储、暴露在潮湿环境中、暴露在温度过高或过低环境中；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （3）未经授权的修理、误用、疏忽、滥用、事故、改动；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （4）不正确的安装、不可抗力、食物或液体溅落、产品的正常磨损等；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （5）退回的商品已打开塑封包装或撕开开箱即损贴纸、包装不完整、所附配件及资料不全、赠品不齐全；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （6）发货单丢失、涂改或损坏；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp; （7） 毛绒玩具一旦签收，非电子类元件故障，不享受退货。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n'),(100010,100015,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><strong><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">退货办理流程：</span></strong></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">1、进入</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">用户中心点击</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&ldquo;我的订单&rdquo;找到需要退货的</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">商品</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">点击&ldquo;申请退货&rdquo;，上传能显示商品质量问题的照片；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">2、商家会</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">尽快</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">确认是否准于退货；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">3、邮寄商品给商家</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">，需先垫付费用；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">4、商家</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">确认退货后，新龙会</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">尽快</span><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">打款给买家；</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\">&nbsp;</p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;<img alt=\"\" src=\"http://f.xlbuy365.com/file/media/uhome/helpDescribe/2013/04/11/9f2ca450-3332-4645-a829-5f1e74742847.png\" /></span></p>\n'),(100011,100016,'<p><span style=\"font-family: Arial; line-height: normal;\">&ldquo;<strong>新龙直销</strong>&rdquo;是上海圆通新龙电子商务有限公司旗下在2013年推出又一全新品牌，依托投资方圆通蛟龙投资发展（集团）有限公司强大的集团资源及行业优势，秉承圆通新龙电子商务有限公司为广大家庭提供一站式购物的理念，致力于打造一个值得消费者信赖的平台。&ldquo;新龙直销&rdquo;将通过集成供应商丰富多彩的商品和营造健康、快乐、时尚的生活方式，帮助消费者快速、便捷、安全的实现满意消费；通过量身定制的各种服务项目和解决方案，帮助品牌供应商在降低销售成本的同时快速开拓网络销售通路，扩大品牌影响力，实现供应商、消费者都满意的共赢局面。</span></p>\n'),(100012,100017,'<p><span style=\"font-family: Arial; line-height: normal;\">汉麻世家&nbsp;&nbsp; 本草堂&nbsp;&nbsp; 莱唯德 &nbsp; 朗白先生 &nbsp; Renuzit &nbsp; 香必飘 &nbsp; 露华浓</span></p>\n'),(100013,100018,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">如果您对我们的网站、商品和服务有任何意见或建议欢迎您随时与我们联络，我们将竭诚为您服务。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">服务热线：021-60904618</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">客服邮箱：service@xlbuy365.com</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">工作时间：周一到周五，上午：8：30-11：30，下午13：00：00-18：00（节假日除外）</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">办公地址：上海市徐汇区桂林路396号1号楼5楼（注：此地址不接受退换货）</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">&nbsp;</span></p>\n'),(100015,100020,'<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">新龙直销本着互惠共赢的原则与广大供应商精诚合作，我们会及时准确地将各种销售信息和用户体验反馈给供应商伙伴，帮助供应商伙伴更好地了解销售状况，市场需求，并及时准确地作出货品调整，从而获得良好的业绩表现。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">诚邀国内外知名品牌的优质供应商，与新龙携手合作共谋发展。</span></p>\n\n<p style=\"margin: 0px; color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: normal;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51);\">请供应商提供如下资料至新龙直销招商部的邮箱： merchant@xlbuy365.com，并务必附上联系方式，以便我司能尽快与您联系洽谈合作事宜。</span></p>\n');
